(463, '73e2d2454865f737ddce1efc80ce0733', 'a:2:{s:7:\"timeout\";i:1555673417;s:5:\"value\";s:16420:\"{\"new_version\":\"2.1.5\",\"stable_version\":\"2.1.5\",\"name\":\"Fullwidth Header Extended\",\"slug\":\"class-dwd-custom-fullwidth-header-extended-license\",\"url\":\"https:\\/\\/elegantmarketplace.com\\/?post_type=download&#038;p=50214&#038;changelog=1\",\"last_updated\":\"2019-01-06 12:47:32\",\"homepage\":\"https:\\/\\/elegantmarketplace.com\\/?post_type=download&p=50214\",\"package\":\"https:\\/\\/elegantmarketplace.com\\/edd-sl\\/package_download\\/MTU1NTkyNTQxNzo5NTJjNjk2ZjJjNThiZTZiNTMwZTg3NDNlMzBjZmU3Mzo1MDIxNDoxMGUwMjQ5ZGQyZjMzZmE1NDNlZjBhMzFhMzA1NjgxYzpodHRwQC8vd3d3Lm1pam4tcG9ydGZvbGlvMTkuY29tOjA=\",\"download_link\":\"https:\\/\\/elegantmarketplace.com\\/edd-sl\\/package_download\\/MTU1NTkyNTQxNzo5NTJjNjk2ZjJjNThiZTZiNTMwZTg3NDNlMzBjZmU3Mzo1MDIxNDoxMGUwMjQ5ZGQyZjMzZmE1NDNlZjBhMzFhMzA1NjgxYzpodHRwQC8vd3d3Lm1pam4tcG9ydGZvbGlvMTkuY29tOjA=\",\"sections\":{\"description\":\"<p><strong>More than 4000 customers and counting from around the world rely on Divi Fullwidth Header Extended. Featured on Element Themes blog topic on 10 Awesome Third-Party Divi Plugins. One of the must have for Divi sites.<\\/strong><\\/p>\\n<p>Impress your visitors with a whole new experience! The Divi Fullwidth Header Extended module provides a comprehensive suite of header customizations that helps you easily create dynamic text effects, image effects, background animations and more.<\\/p>\\n<p>Divi Fullwidth Header Extended module brings you 5 title text effects to play around with. You can choose to have purely typing, rotator, textillate, TextGIF, shuffle effect or some static text in front while typing\\/rotator effect following after it at the same time.<\\/p>\\n<p>Use a Fancy Line to bring attention to your title. Toggle the line on top or bottom of the title, change the color and alignment, have fun and see what works best for you. You can also easily add a sub-header and toggle it to be above or below the header title.<\\/p>\\n<p>Divi Fullwidth Header Extended module also provides you the capability to animate your background with the latest particles effect, background gradient or an animated gradient effect. It\\u2019s up to your creativity.<\\/p>\\n<p>Want a search input right on the header or even a video popup? We\\u2019ve taken care of that.<\\/p>\\n<p>Custom scroll down icon\\/image? We\\u2019ve taken care of that.<\\/p>\\n<p>Last but not least, Divi Fullwidth Header Extended module is packed with a total of 49 animations which you can apply to the entire content or set individually on title, subheading, content, buttons and scroll down icon!<\\/p>\\n<p>We\'ve done the hard part. So now, as the saying goes, it\\u2019s up to your creativity. Enjoy the Divi Fullwidth Header Extended module!<\\/p>\\n<p>FREE: Added a free Fullwidth Text Extended module!<\\/p>\\n<p><strong>5 Title effects:<\\/strong><br \\/>\\nYou can choose to have purely typing, rotator, textillate, TextGIF or shuffle effect or some static text in front while typing\\/rotator effect following after it at the same time.<\\/p>\\n<p><strong>Typing Effect<\\/strong><\\/p>\\n<ul>\\n<li>You can define the speed of the typing speed<\\/li>\\n<li>Delay the time of effect<\\/li>\\n<li>Delay the time before backspacing<\\/li>\\n<li>Enable\\/Disable looping effect<\\/li>\\n<li>Change the color of typing font<\\/li>\\n<li>Change the color of the backspace<\\/li>\\n<\\/ul>\\n<p><strong>Rotator Effect(Lots of Animation)<\\/strong><\\/p>\\n<ul>\\n<li>You can define the speed of the rotator speed<\\/li>\\n<li>Change the color of rotator font<\\/li>\\n<\\/ul>\\n<p><strong>Textillate Effect<\\/strong><\\/p>\\n<ul>\\n<li>Many Animation for In and Out Animation Effects<\\/li>\\n<li>4 Types of animation type (Sequence, Reverse, Sync and Shuffle) for In and Out Effect<\\/li>\\n<\\/ul>\\n<p><strong>TextGIF Effect<\\/strong><\\/p>\\n<ul>\\n<li>TextGIF effect to make your text like a hole in the page by using gif images<\\/li>\\n<li>Add image background effect<\\/li>\\n<\\/ul>\\n<p><strong>Shuffle Effect<\\/strong><\\/p>\\n<ul>\\n<li>Shuffle effect add shuffle effect to title, by flipping each letter of your text with sequential characters<\\/li>\\n<\\/ul>\\n<p><strong>Fancy Line on Title<\\/strong><\\/p>\\n<ul>\\n<li>You can select to choose before or after the title<\\/li>\\n<li>Text alignment and line alignment<\\/li>\\n<li>Line spacing on the top and bottom<\\/li>\\n<li>Set line color<\\/li>\\n<\\/ul>\\n<p><strong>Search Input<\\/strong><\\/p>\\n<ul>\\n<li>Custom Styles for Search Input<\\/li>\\n<li>Choose search type: Default Posts\\/Pages or WooCommerce<\\/li>\\n<\\/ul>\\n<p><strong>7 Background Effects:<\\/strong><\\/p>\\n<ul>\\n<li>Particles Background Effect \\u2013 Options such as (Number of Particles, Particle Size, Shape of the Particles(Circle, Triangle,Edge, Polygon, Star), Particle Line Linked Width, Particle Movement Speed, Particle Color)<\\/li>\\n<li>Moving Particles Background Effect \\u2013 The particles will follow your mouse cursor as you move<\\/li>\\n<li>5 types of background gradient (Left to Right \\u2192 \\u2013 Top to Bottom \\u2193 \\u2013 Radial \\u25cb \\u2013 Diagonal\\u00a0&#x2198;\\u00a0\\u2013 Diagonal\\u00a0&#x2197;)<\\/li>\\n<li>Animated Gradient Background Effect(Solid or Transparent)<\\/li>\\n<li>Ken Burns Background Effect \\u2013 Apply Ken Burns effect to the background image with option such as (Zoom In, Zoom In Left, Zoom In Right, Zoomout, Zoomout Left, Zoomout Right)<\\/li>\\n<li>Interactive Background Effect \\u2013 This will move your background image on mouse move.<\\/li>\\n<li>Wave Animation Effect \\u2013 Able to change color, speed, amplitude and height.<\\/li>\\n<\\/ul>\\n<p><strong>Slicey Effect<\\/strong><\\/p>\\n<ul>\\n<li>This will replicate boxes from the background URL you provided with the same background image and make these boxes move in perspective towards the viewer. This will spice up and add some jazz to background image. Note: This might not work with older browsers. (Inspired by Filippo Bello\\u2019s Portfolio)<\\/li>\\n<\\/ul>\\n<p><strong>Subheading before or after title<\\/strong><\\/p>\\n<ul>\\n<li>You can set subheading to be before or after the title. More flexible now.<\\/li>\\n<\\/ul>\\n<p><strong>Custom image\\/icon for scroll down icon<\\/strong><\\/p>\\n<p><strong>49 Animations to choose from:<\\/strong><\\/p>\\n<ul>\\n<li>Set animation on the whole section<\\/li>\\n<li>Set animation\\/delay effect on title, sub heading, image, content, buttons and scroll down buttons<\\/li>\\n<\\/ul>\\n<p><strong>Video Popup:<\\/strong><\\/p>\\n<ul>\\n<li>Video links will be taken from button one or button two input<\\/li>\\n<li>On click popup on button one, button two or both<\\/li>\\n<\\/ul>\\n<p><strong>Content Popup:<\\/strong><\\/p>\\n<ul>\\n<li>Header Background and Header Text, Show Title, Content, Background image or buttons with Advanced Styling<\\/li>\\n<li>On click popup on button one, button two or both<\\/li>\\n<li>Fullscreen Popup<\\/li>\\n<li>Header Background Image and Header Title<\\/li>\\n<li>Trigger Animation In and Out of the Popup<\\/li>\\n<\\/ul>\\n<p><strong>Text Gradient:<\\/strong><\\/p>\\n<ul>\\n<li>Apply Gradient to Title, Sub Heading and Content<\\/li>\\n<\\/ul>\\n<p><strong>Basic Separator:<\\/strong><\\/p>\\n<ul>\\n<li>Separator Type(Triangles, Half Circle, Multi Triangles, Diagonal)<\\/li>\\n<li>Advanced Settings such as color, before or after section<\\/li>\\n<\\/ul>\\n<p><strong>Wider Mobile Space Option<\\/strong><\\/p>\\n<ul>\\n<li>You can a wider width space on mobile. Very useful if you have many text on the content area or long button text. This will adjust the width to 95%.<\\/li>\\n<\\/ul>\\n<p><strong>Video URL<\\/strong><\\/p>\\n<ul>\\n<li>If you add a video URL, it will appear to the right of your content.<\\/li>\\n<li>Video On Mobile \\u2013 As the size of the screen gets smaller on mobile devices, screen real estate becomes more precious. Sometimes it\\u2019s a good idea to disable some less important header elements to reduce the size of the header and make it more readable. Enabling this setting will show videos on mobile (they are disabled by default).<\\/li>\\n<\\/ul>\\n<p><strong>Auto Fetch Content<\\/strong><\\/p>\\n<ul>\\n<li>Auto Title \\u2013 Fetch Page\\/Post Title automatically<\\/li>\\n<li>Auto Excerpt \\u2013 Fetch Page\\/Post Excerpt automatically<\\/li>\\n<li>Featured Image as Background Image \\u2013 Fetch Featured Image from your post\\/page automatically and set as Background<\\/li>\\n<\\/ul>\\n<p><strong>Version: 2.1.5 Updated: 22 Jan, 2018<\\/strong><\\/p>\\n<p><strong><a href=\\\"https:\\/\\/diviwebdesign.com\\/documentation\\/fullwidth-header-extended\\/\\\">Plugin Documentation<\\/a><\\/strong><\\/p>\\n\",\"changelog\":\"\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":\"a:2:{s:2:\\\"1x\\\";s:91:\\\"https:\\/\\/elegantmarketplace.com\\/wp-content\\/uploads\\/2016\\/07\\/emp-fullwidth-header-extended.png\\\";s:2:\\\"2x\\\";s:91:\\\"https:\\/\\/elegantmarketplace.com\\/wp-content\\/uploads\\/2016\\/07\\/emp-fullwidth-header-extended.png\\\";}\",\"tested\":\"4.9.6\",\"compatibility\":\"a:1:{s:5:\\\"4.9.6\\\";a:1:{s:6:\\\"1.0.18\\\";a:3:{i:0;s:4:\\\"100%\\\";i:1;s:1:\\\"5\\\";i:2;s:1:\\\"5\\\";}}}\",\"description\":[\"<p><strong>More than 4000 customers and counting from around the world rely on Divi Fullwidth Header Extended. Featured on Element Themes blog topic on 10 Awesome Third-Party Divi Plugins. One of the must have for Divi sites.<\\/strong><\\/p>\\n<p>Impress your visitors with a whole new experience! The Divi Fullwidth Header Extended module provides a comprehensive suite of header customizations that helps you easily create dynamic text effects, image effects, background animations and more.<\\/p>\\n<p>Divi Fullwidth Header Extended module brings you 5 title text effects to play around with. You can choose to have purely typing, rotator, textillate, TextGIF, shuffle effect or some static text in front while typing\\/rotator effect following after it at the same time.<\\/p>\\n<p>Use a Fancy Line to bring attention to your title. Toggle the line on top or bottom of the title, change the color and alignment, have fun and see what works best for you. You can also easily add a sub-header and toggle it to be above or below the header title.<\\/p>\\n<p>Divi Fullwidth Header Extended module also provides you the capability to animate your background with the latest particles effect, background gradient or an animated gradient effect. It\\u2019s up to your creativity.<\\/p>\\n<p>Want a search input right on the header or even a video popup? We\\u2019ve taken care of that.<\\/p>\\n<p>Custom scroll down icon\\/image? We\\u2019ve taken care of that.<\\/p>\\n<p>Last but not least, Divi Fullwidth Header Extended module is packed with a total of 49 animations which you can apply to the entire content or set individually on title, subheading, content, buttons and scroll down icon!<\\/p>\\n<p>We\'ve done the hard part. So now, as the saying goes, it\\u2019s up to your creativity. Enjoy the Divi Fullwidth Header Extended module!<\\/p>\\n<p>FREE: Added a free Fullwidth Text Extended module!<\\/p>\\n<p><strong>5 Title effects:<\\/strong><br \\/>\\nYou can choose to have purely typing, rotator, textillate, TextGIF or shuffle effect or some static text in front while typing\\/rotator effect following after it at the same time.<\\/p>\\n<p><strong>Typing Effect<\\/strong><\\/p>\\n<ul>\\n<li>You can define the speed of the typing speed<\\/li>\\n<li>Delay the time of effect<\\/li>\\n<li>Delay the time before backspacing<\\/li>\\n<li>Enable\\/Disable looping effect<\\/li>\\n<li>Change the color of typing font<\\/li>\\n<li>Change the color of the backspace<\\/li>\\n<\\/ul>\\n<p><strong>Rotator Effect(Lots of Animation)<\\/strong><\\/p>\\n<ul>\\n<li>You can define the speed of the rotator speed<\\/li>\\n<li>Change the color of rotator font<\\/li>\\n<\\/ul>\\n<p><strong>Textillate Effect<\\/strong><\\/p>\\n<ul>\\n<li>Many Animation for In and Out Animation Effects<\\/li>\\n<li>4 Types of animation type (Sequence, Reverse, Sync and Shuffle) for In and Out Effect<\\/li>\\n<\\/ul>\\n<p><strong>TextGIF Effect<\\/strong><\\/p>\\n<ul>\\n<li>TextGIF effect to make your text like a hole in the page by using gif images<\\/li>\\n<li>Add image background effect<\\/li>\\n<\\/ul>\\n<p><strong>Shuffle Effect<\\/strong><\\/p>\\n<ul>\\n<li>Shuffle effect add shuffle effect to title, by flipping each letter of your text with sequential characters<\\/li>\\n<\\/ul>\\n<p><strong>Fancy Line on Title<\\/strong><\\/p>\\n<ul>\\n<li>You can select to choose before or after the title<\\/li>\\n<li>Text alignment and line alignment<\\/li>\\n<li>Line spacing on the top and bottom<\\/li>\\n<li>Set line color<\\/li>\\n<\\/ul>\\n<p><strong>Search Input<\\/strong><\\/p>\\n<ul>\\n<li>Custom Styles for Search Input<\\/li>\\n<li>Choose search type: Default Posts\\/Pages or WooCommerce<\\/li>\\n<\\/ul>\\n<p><strong>7 Background Effects:<\\/strong><\\/p>\\n<ul>\\n<li>Particles Background Effect \\u2013 Options such as (Number of Particles, Particle Size, Shape of the Particles(Circle, Triangle,Edge, Polygon, Star), Particle Line Linked Width, Particle Movement Speed, Particle Color)<\\/li>\\n<li>Moving Particles Background Effect \\u2013 The particles will follow your mouse cursor as you move<\\/li>\\n<li>5 types of background gradient (Left to Right \\u2192 \\u2013 Top to Bottom \\u2193 \\u2013 Radial \\u25cb \\u2013 Diagonal\\u00a0&#x2198;\\u00a0\\u2013 Diagonal\\u00a0&#x2197;)<\\/li>\\n<li>Animated Gradient Background Effect(Solid or Transparent)<\\/li>\\n<li>Ken Burns Background Effect \\u2013 Apply Ken Burns effect to the background image with option such as (Zoom In, Zoom In Left, Zoom In Right, Zoomout, Zoomout Left, Zoomout Right)<\\/li>\\n<li>Interactive Background Effect \\u2013 This will move your background image on mouse move.<\\/li>\\n<li>Wave Animation Effect \\u2013 Able to change color, speed, amplitude and height.<\\/li>\\n<\\/ul>\\n<p><strong>Slicey Effect<\\/strong><\\/p>\\n<ul>\\n<li>This will replicate boxes from the background URL you provided with the same background image and make these boxes move in perspective towards the viewer. This will spice up and add some jazz to background image. Note: This might not work with older browsers. (Inspired by Filippo Bello\\u2019s Portfolio)<\\/li>\\n<\\/ul>\\n<p><strong>Subheading before or after title<\\/strong><\\/p>\\n<ul>\\n<li>You can set subheading to be before or after the title. More flexible now.<\\/li>\\n<\\/ul>\\n<p><strong>Custom image\\/icon for scroll down icon<\\/strong><\\/p>\\n<p><strong>49 Animations to choose from:<\\/strong><\\/p>\\n<ul>\\n<li>Set animation on the whole section<\\/li>\\n<li>Set animation\\/delay effect on title, sub heading, image, content, buttons and scroll down buttons<\\/li>\\n<\\/ul>\\n<p><strong>Video Popup:<\\/strong><\\/p>\\n<ul>\\n<li>Video links will be taken from button one or button two input<\\/li>\\n<li>On click popup on button one, button two or both<\\/li>\\n<\\/ul>\\n<p><strong>Content Popup:<\\/strong><\\/p>\\n<ul>\\n<li>Header Background and Header Text, Show Title, Content, Background image or buttons with Advanced Styling<\\/li>\\n<li>On click popup on button one, button two or both<\\/li>\\n<li>Fullscreen Popup<\\/li>\\n<li>Header Background Image and Header Title<\\/li>\\n<li>Trigger Animation In and Out of the Popup<\\/li>\\n<\\/ul>\\n<p><strong>Text Gradient:<\\/strong><\\/p>\\n<ul>\\n<li>Apply Gradient to Title, Sub Heading and Content<\\/li>\\n<\\/ul>\\n<p><strong>Basic Separator:<\\/strong><\\/p>\\n<ul>\\n<li>Separator Type(Triangles, Half Circle, Multi Triangles, Diagonal)<\\/li>\\n<li>Advanced Settings such as color, before or after section<\\/li>\\n<\\/ul>\\n<p><strong>Wider Mobile Space Option<\\/strong><\\/p>\\n<ul>\\n<li>You can a wider width space on mobile. Very useful if you have many text on the content area or long button text. This will adjust the width to 95%.<\\/li>\\n<\\/ul>\\n<p><strong>Video URL<\\/strong><\\/p>\\n<ul>\\n<li>If you add a video URL, it will appear to the right of your content.<\\/li>\\n<li>Video On Mobile \\u2013 As the size of the screen gets smaller on mobile devices, screen real estate becomes more precious. Sometimes it\\u2019s a good idea to disable some less important header elements to reduce the size of the header and make it more readable. Enabling this setting will show videos on mobile (they are disabled by default).<\\/li>\\n<\\/ul>\\n<p><strong>Auto Fetch Content<\\/strong><\\/p>\\n<ul>\\n<li>Auto Title \\u2013 Fetch Page\\/Post Title automatically<\\/li>\\n<li>Auto Excerpt \\u2013 Fetch Page\\/Post Excerpt automatically<\\/li>\\n<li>Featured Image as Background Image \\u2013 Fetch Featured Image from your post\\/page automatically and set as Background<\\/li>\\n<\\/ul>\\n<p><strong>Version: 2.1.5 Updated: 22 Jan, 2018<\\/strong><\\/p>\\n<p><strong><a href=\\\"https:\\/\\/diviwebdesign.com\\/documentation\\/fullwidth-header-extended\\/\\\">Plugin Documentation<\\/a><\\/strong><\\/p>\\n\"],\"changelog\":[\"\"]}\";}', 'no'),
