(15687, 1, '2020-12-01 23:06:08', '2020-12-01 23:06:08', '<label> Je naam\r\n    [text* your-name] </label>\r\n\r\n<label> Je e-mailadres\r\n    [email* your-email] </label>\r\n\r\n<label> Onderwerp\r\n    [text* your-subject] </label>\r\n\r\n<label> Je bericht (optioneel)\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Verzenden\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@fayaaz.externeklant.nl>\n[_site_admin_email]\nVan: [your-name] <[your-email]>\r\nOnderwerp: [your-subject]\r\n\r\nBerichtinhoud:\r\n[your-message]\r\n\r\n-- \r\nDeze e-mail is verzonden vanuit het contactformulier op [_site_title] [_site_url]\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@fayaaz.externeklant.nl>\n[your-email]\nBerichtinhoud:\r\n[your-message]\r\n\r\n-- \r\nDeze e-mail is verzonden vanuit het contactformulier op [_site_title] [_site_url]\nReply-To: [_site_admin_email]\n\n\n\nBedankt voor uw bericht; het is verzonden.\nEr is een fout opgetreden bij het versturen van het bericht; probeer het later nog eens.\nEen of meer velden bevatten een fout; graag controleren en opnieuw proberen.\nEr is een fout opgetreden bij het versturen van het bericht; probeer het later nog eens.\nJe moet de voorwaarden accepteren voordat je het bericht kunt verzenden.\nHet veld is verplicht.\nHet veld is te lang.\nHet veld is te kort.\nDe datumnotatie is incorrect.\nDe ingevulde datum valt voor de eerst toegestane.\nDe ingevulde datum valt na de laatst toegestane.\nEr is een onbekende fout opgetreden bij het uploaden van het bestand.\nHet is niet toegestaan dit type bestand te uploaden.\nHet bestand is te groot.\nEr is een fout opgetreden bij het uploaden van het bestand.\nDe getalsnotatie is ongeldig.\nHet ingevulde getal is kleiner dan het kleinst toegestane.\nHet ingevulde getal is groter dan het hoogst toegestane.\nHet antwoord op de quiz is incorrect.\nHet ingevoerde e-mailadres is ongeldig.\nDe URL is ongeldig.\nHet telefoonnu