INSERT INTO `xszn_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
(2, 'wc-admin-onboarding-profiler-reminder', 'update', 'en_US', 'Welcome to WooCommerce! Set up your store and start selling', 'We\'re here to help you going through the most important steps to get your store up and running.', '{}', 'actioned', 'woocommerce-admin', '2020-11-28 13:18:46', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Tips, product updates, and inspiration', 'We\'re here for you - get tips, product updates and inspiration straight to your email box', '{}', 'unactioned', 'woocommerce-admin', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(4, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(5, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(6, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(7, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(8, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store\'s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(9, 'wcpay-subscriptions-2020-11', 'marketing', 'en_US', 'Manage subscriber payments from your store\'s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-11-28 13:18:47', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wc-admin-test-checkout', 'info', 'en_US', 'Vergeet je afrekenproces niet te testen', 'Zorg dat je afrekenproces goed werkt voordat je je winkel lanceert. Doorloop het gehele afrekenproces: van het toevoegen van een product aan je winkelwagen tot het kiezen van een verzendlocatie en het betaalproces.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-28 14:38:51', NULL, 0, 'plain', '', 0, 'info'),
(11, 'wc-admin-orders-milestone', 'info', 'en_US', 'Eerste bestelling ontvangen', 'Gefeliciteerd met je eerste bestelling! Dit is een geweldig moment om te ontdekken hoe je je bestellingen beheert.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-28 15:18:50', NULL, 0, 'plain', '', 0, 'info'),
(12, 'wc-admin-launch-checklist', 'info', 'en_US', 'Klaar om je winkel te lanceren?', 'Om er zeker van te zijn dat je nooit dat knagende gevoel hebt van \'wat ben ik vergeten?\' hebben we de essentiële checklist voor de lancering samengesteld.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-29 21:21:27', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wc-admin-mobile-app', 'info', 'en_US', 'Installeer de Woo-app voor mobiel', 'Installeer de WooCommerce-app voor mobiel om overal waar je bent bestellingen te beheren, verkoopmeldingen te ontvangen en belangrijke meetgegevens te bekijken.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-30 15:17:45', NULL, 0, 'plain', '', 0, 'info'),
(14, 'wc-admin-new-sales-record', 'info', 'en_US', 'Nieuw omzetrecord!', 'Geweldig, December 1st is de dag dat je het meeste omzet hebt gedraaid! De netto-omzet was €119,98 en verslaat het eerdere record van €45,00 van November 28th.', '{\"old_record_date\":\"2020-11-28\",\"old_record_amt\":45,\"new_record_date\":\"2020-12-01\",\"new_record_amt\":119.98}', 'unactioned', 'woocommerce-admin', '2020-12-02 15:15:48', NULL, 0, 'plain', '', 0, 'info'),
(15, 'wc-admin-need-some-inspiration', 'info', 'en_US', 'Op zoek naar inspiratie?', 'Bekijk een aantal van onze favoriete testimonials van ondernemers, bureaus en ontwikkelaars van onze wereldwijde community.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-03 19:50:59', NULL, 0, 'plain', '', 0, 'info'),
(16, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Geef feedback', 'Nu je ons hebt gekozen als partner is het ons doel om te zorgen dat wij je van de juiste tools kunnen voorzien om aan je behoeften te voldoen. We kijken ernaar uit om je feedback over de winkelconfiguratie te lezen, zodat we deze in de toekomst kunnen verbeteren.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-06 17:51:07', NULL, 0, 'plain', '', 0, 'info'),
(17, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Wist je dat?', 'Een winkel waarop WooCommerce wordt uitgevoerd, verkoopt zijn eerste product gemiddeld binnen 31 dagen. Je bent op de goede weg! Vind je dit soort informatie nuttig?', '{}', 'unactioned', 'woocommerce-admin', '2020-12-06 17:51:07', NULL, 0, 'plain', '', 0, 'info'),
(18, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'Get 50% off transaction fees with WooCommerce Payments', 'Keep more of your hard-earned cash by adding <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking \"Install now,\" you agree to our promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-12-10 03:56:33', NULL, 0, 'plain', '', 0, 'info'),
(19, 'wcpay-subscriptions-2020-12', 'marketing', 'en_US', 'Manage payments from your store\'s dashboard', 'Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>', '{}', 'pending', 'woocommerce.com', '2020-12-10 03:56:33', NULL, 0, 'plain', '', 0, 'info'),
(20, 'wc-admin-home-screen-feedback', 'info', 'en_US', 'Help ons het WooCommerce-startscherm verbeteren', 'We horen graag jouw input om de toekomst van het WooCommerce-startscherm samen vorm te geven. Aarzel niet om je feedback, ideeën of suggesties met ons te delen.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-10 21:19:33', NULL, 0, 'plain', '', 0, 'info'),
(21, 'wc-admin-customize-store-with-blocks', 'info', 'en_US', 'Pas je webwinkel aan met WooCommerce-blokken', 'Met onze blokken kan je producten, categorieën, filters en meer bijna overal op je site selecteren en weergeven. Je hoeft geen shortcodes te gebruiken of regels code te bewerken. Bekijk meer informatie over hoe je ze kan gebruiken.', '{}', 'unactioned', 'woocommerce-admin', '2020-12-12 14:35:06', NULL, 0, 'plain', '', 0, 'info'),
(22, 'your-first-product', 'info', 'en_US', 'Your first product', 'That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.', '{}', 'pending', 'woocommerce.com', '2021-01-21 14:07:45', NULL, 0, 'plain', '', 0, 'info');
